import "./ProfileInfoStyle.css"

export default function ProfileInfo(profile) {
    console.log(profile);
    return (
        <div className="user-profile">
            <div className="user-img">
                <div className="img-border"><img src={profile.profile.picture.large}/></div>
            </div>
            <div className="user-info">
                <p className="name">Name: {profile.profile.name.first}</p>
                <p className="age">Age: {profile.profile.dob.age}</p>
                <p className="location">Location: {profile.profile.location.country}</p>
            </div>
        </div>
    )

}
